import React, { Component } from 'react';
import Aux from './../../HOC/Aux';
import { Link } from './../../routes';
import styles from './Layout.module.css';

class Layout extends Component {
    render() {
        return (
            <Aux>
                <div className={styles.Container}>
                    <header className={styles.Header}>
                        <div className={styles.LogoBox}>
                            <img src="/static/tiranga_national_emblem.png" alt="logo" />
                        </div>
                        <div className={styles.NavBox}>
                            <ul>
                                <li> <Link route="/superAdmin/addAdmin"> <a href="#"> Add Admin </a> </Link> </li>
                                <li> <Link route="/superAdmin/explore"> <a href="#"> Explore </a> </Link> </li>
                                <li> <Link route="/superAdmin/registerLand"> <a href="#"> Register Land </a> </Link> </li>
                            </ul>
                        </div>
                    </header>
                    <div className={styles.clearfix}></div>

                    {this.props.children}

                </div>
            </Aux>
        );
    }
}

export default Layout;
